soup = BeautifulSoup(html, 'html.parser')

# Encontrar a div que contém a lista de cidades
cidade_div = soup.find('div', class_='ui active visible error search selection dropdown')

# Encontrar todas as opções de cidade dentro da div
cidades = cidade_div.find_all('div', role='option')

# Iterar sobre as opções e extrair os nomes e códigos
lista_cidades = []
for cidade in cidades:
    nome = cidade.span.text
    codigo = cidade.span.text.split()[-1].strip('()')
    lista_cidades.append(f"{nome} - {codigo}")

# Imprimir a lista de cidades e códigos
for cidade in lista_cidades:
    print(cidade)